class EditComponent {
    constructor(fb, actRoute, apiService, router) {
        this.fb = fb;
        this.actRoute = actRoute;
        this.apiService = apiService;
        this.router = router;
        // super(route);
        this.surveyForm = this.fb.group({
            title: '',
            question1: '',
            question2: '',
            question3: ''
        });
    }
    ngOnInit() {
        // this.title = 'DEFG?';
        const id = this.actRoute.snapshot.paramMap.get('id');
        this.getSurveyOne(id);
    }
    getSurveyOne(id) {
        this.apiService.getSurveyOne(id).subscribe(data => {
            this.surveyForm.setValue({
                title: data['title'],
                question1: data['question1'],
                question2: data['question2'],
                question3: data['question3']
            });
        });
    }
    onSubmit() {
        if (!this.surveyForm.valid) {
            return false;
        }
        else {
            if (window.confirm('Are you sure?')) {
                const id = this.actRoute.snapshot.paramMap.get('id');
                if (id) {
                    this.apiService.updateSurvey(id, this.surveyForm.value)
                        .subscribe(res => {
                        this.router.navigateByUrl('/survey');
                        console.log('Updated successfully.');
                    }, (err) => {
                        console.log(err);
                    });
                }
                else {
                    this.apiService.createSurvey(this.surveyForm.value)
                        .subscribe(res => {
                        this.router.navigateByUrl('/survey');
                        console.log('Created successfully.');
                    }, (err) => {
                        console.log(err);
                    });
                }
            }
        }
    }
}
